import {useState, useEffect} from 'react';

const Posts = () => {
    const [posts, setPosts] = useState([])

    const fetch_posts = () => {
        let url = "https://jsonplaceholder.typicode.com/posts"
        fetch(url)
        .then(response => response.json())
        .then(res => {
            setPosts(res);
        })
    }
    useEffect(()=>{
        fetch_posts();
    })


    return (
        <h1>Posts</h1>
    )
}

export default Posts;
